import "./Online.css"
import { IconButton } from '@mui/material'
import SearchOutlinedIcon from '@mui/icons-material/SearchOutlined';
import Testuser from './Testuser';
import { useSelector } from 'react-redux';
function Onlineuser() {
  const light=useSelector((state)=>state)
  return (
    <div className={`onlineusercontainer${light ? "" : " dark1"}`}>
     <div className='onlinehead'>
        
           <img className='onlineimg' src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRbdgywUyi3GeY8033J2rl2M7RnKqyPCQW8dQ&s" alt="" /> 
     
        <h1 className='h1ofonline'>Online user</h1>
     </div>

  {/* search bar */}
  <div className="side-bar-text1">
        <IconButton>
          <SearchOutlinedIcon />
        </IconButton>

        <input className='textarea2' type="text" placeholder='Search' />
      </div>

{/* textuser componet */}
    <Testuser/>
    <Testuser/>
    <Testuser/>
    <Testuser/>
    <Testuser/>
    <Testuser/>

    </div>

    
  
  )
}

export default Onlineuser
